const quizzes = [
    {
      question: "What is trading?",
      options: [
        "Buying and selling financial instruments",
        "Storing assets in a bank",
        "Gambling on the stock market",
        "None of the above"
      ],
      correctAnswer: "Buying and selling financial instruments",
    },
    {
      question: "Which of the following is NOT a type of trading market?",
      options: [
        "Stock Market",
        "Forex Market",
        "Commodity Market",
        "Retail Market"
      ],
      correctAnswer: "Retail Market",
    },
    {
      question: "What does RSI stand for in trading?",
      options: [
        "Relative Stock Index",
        "Relative Strength Index",
        "Resistant Stock Indicator",
        "Rapid Strength Indicator"
      ],
      correctAnswer: "Relative Strength Index",
    },
    {
      question: "Which type of trading strategy involves holding positions for weeks or months?",
      options: [
        "Day Trading",
        "Scalping",
        "Swing Trading",
        "Position Trading"
      ],
      correctAnswer: "Position Trading",
    },
    {
      question: "What is the primary purpose of a stop-loss order?",
      options: [
        "To ensure a trade is profitable",
        "To limit potential losses",
        "To buy an asset at a lower price",
        "To predict market trends"
      ],
      correctAnswer: "To limit potential losses",
    },
  ];
  
  export default quizzes;
